ideo signals, the 226BW monitor is future-ready.'),(380,10,506,0,147,'The wide, 16:10 format of SAMSUNG\'s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft Vista Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.'),(381,10,531,0,147,''),(386,10,499,0,149,'1 TB'),(387,10,104,0,149,''),(388,10,97,0,149,'1 TB - 7200RPM, SATA 3.0Gb/s, 32MB Cache'),(389,10,506,0,149,'1 TB - 7200RPM, SATA 3.0Gb/s, 32MB Cache'),(390,10,531,0,149,''),(391,10,499,0,150,'500 GB'),(392,10,531,0,150,NULL),(395,10,500,0,152,'24\"'),(396,10,104,0,152,''),(397,10,97,0,152,'With ultrafine 10,000:1 contrast and wide 170 viewing angles, this 24\" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device.\r\n\r\nProduct Features:\r\n    * Ultrafast 5 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 400 cd/m brightness\r\n    * 1920 x 1200 maximum resolution; wide 170 horizontal and vertical viewing angles\r\n'),(398,10,506,0,152,'5 ms response time; 10,000:1 contrast ratio; 400 cd/m brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs'),(399,10,506,0,153,'Intel Core 2 Extreme QX9775 Processor BX80574QX9775 - 45nm, 3.20GHz, 12MB Cache, 1600MHz FSB, Yorkfield XE, Quad-Core, Retail, Socket 771, Processor'),(400,10,104,0,154,''),(401,10,97,0,154,'1 TB - 7200RPM, SATA 3.0Gb/s, 32MB Cache'),(402,10,506,0,154,'1 TB - 7200RPM, SATA 3.0Gb/s, 32MB Cache'),(403,10,531,0,154,''),(404,10,499,0,155,'5400 rpm'),(405,10,104,0,155,''),(406,10,500,0,156,'19\"'),(407,10,506,0,156,'2 ms response time; 10,000:1 contrast ratio; 300 cd/m brightness; 1440 x 900 maximum resolution; DVI-D and 15-p