n ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device.\r\nProduct Features\r\n\r\n    * Ultrafast 2 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 300 cd/m brightness\r\n    * 1440 x 900 maximum resolution; wide 170 horizontal and vertical viewing angles\r\n'),(688,10,531,0,157,''),(689,10,104,0,158,'Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, '),(690,10,506,0,158,'Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n'),(691,10,531,0,158,''),(693,10,495,0,167,'B000KJ43SG!'),(694,10,104,0,167,'womens, sandal, leather, anashria, '),(695,10,506,0,167,'Buckle embellished contrasting straps adorn both the heel and canvas covered wedge of this t-strap sandal to make it a truly unique addition to your wardrobe'),(696,10,97,0,167,'Smooth kidskin upper in a dress platform wedge t-strap sandal style, with a round open toe, front and ankle adjustable buckles and tonal stitching accents. Ankle buckle features elastic panel. Smooth faux leather lining, cushioning faux leather and fabric topped insole. 1 inch matching leather and fabric wrapped midsole.'),(697,10,492,0,167,'<ul>\r\n<ul class=\"disc\">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon <br></li>\r\n<li>Guaranteed for the Life of the Sole - Non-slip sole<br></li>\r\n</ul>'),(698,10,531,0,167,NULL),(699,10,97,1,166,'<div class=\"product-detail\">\r\n<p><a href=\"#\"><img src=