as it is to use.\r\n\r\nWith HTCs vibrant touch-responsive user interface, TouchFLO 3D, and ultra-fast HSDPA internet connectivity the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends and familys faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.'),(702,10,506,1,166,'Re-defining the perception of advanced mobile phones the HTC Touch Diamond signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.'),(706,10,97,1,156,'Experience smooth gaming visuals and crystal-clear video with this 19\" flat-panel LCD monitor that features an ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device.\r\nProduct Features\r\n\r\n    * Ultrafast 2 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 300 cd/m brightness\r\n    * 1440 x 900 maximum resolution; wide 170 horizontal and vertical viewing angles\r\n'),(707,10,104,1,156,NULL),(708,10,506,1,156,'2 ms response time; 10,000:1 contrast ratio; 300 cd/m brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs'),(709,10,104,0,168,NULL),(710,10,97,0,168,'Configuration Product'),(711,10,506,0,168,'Configuration Product')