ia, '),(740,10,492,1,167,'<ul>\r\n<ul class=\"disc\">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon <br></li>\r\n<li>Guaranteed for the Life of the Sole - Non-slip sole<br></li>\r\n</ul>'),(741,10,506,1,167,'Buckle embellished contrasting straps adorn both the heel and canvas covered wedge of this t-strap sandal to make it a truly unique addition to your wardrobe'),(749,10,97,1,145,'Overclockers dream! Deliver more sophisticated solutions with the leading-edge technology of AMD Phenom 9000 Series processor. Built from the ground up for true quad-core performance, AMD Phenom 9000 Series processors incorporate a unified high-speed L3 cache and high-speed DDR2 memory. Speed through complex multitasking, critical business productivity, advanced visual design and modeling and visually stunning digital media and entertainment. Whether it\'s a single solution or an enterprise system, AMD Phenom processors have the power to perform.'),(750,10,104,1,145,NULL),(751,10,506,1,145,'Deliver more sophisticated solutions with the leading-edge technology of AMD Phenom 9000 Series processor.'),(753,10,97,1,53,'Inspired by the classic camelback sofa, Magento offers comfort and style in a low maintenance package.  For a sleek, simple and stylish piece, look no further than the Magento sofa - or sofabed!'),(754,10,104,1,53,'Couch'),(755,10,506,1,53,'For a sleek, simple and stylish piece, look no further than the Magento sofa - or sofabed!');
