INSERT INTO `catalog_product_flat_1` VALUES (27,39,'simple',NULL,24,'Black',76,'Sony',NULL,NULL,899.9900,NULL,NULL,NULL,'2007-08-24 06:42:19',NULL,NULL,'',' Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n','10.7 x 1.23 x 7.7 inches (WxHxD)',0,NULL,NULL,NULL,NULL,0,NULL,'100 GB Hard Drive',0,'/s/o/sony-vaio-vgn-txn27n-b-11-1-notebook-pc.jpg',NULL,' <ul>\r\n<ul class=\"disc\">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today\'s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel\'s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n\r\n   ',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2 GB RAM','Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVDRW Drive, Vista Business) Charcoal Black','Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, Laptop','Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVDRW Drive, Vista Business) Charcoal Black'