, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.)</li>\r\n</ul>',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1 GB RAM','Toshiba M285-E 14\" Convertible Notebook PC (Intel Core Duo Processor T2300E, 1 GB RAM, 60','Toshiba, notebook, laptop, intel, ','Toshiba Satellite A135-S4527 155.4\" Notebook PC (Intel Pentium Dual Core Processor T2080, 1 GB RAM, 120 GB Hard Drive, SuperMulti DVD Drive, Vista Premium)',1599.9900,'M285-E',NULL,'4',2,'Toshiba M285-E 14\"',NULL,NULL,NULL,1599.9900,NULL,NULL,'1.66 GHz Intel Core Duo T2300E processor',NULL,NULL,0,NULL,NULL,NULL,NULL,'14-inch screen ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Get the competitive edge with the Gateway M285-E. This widescreen Convertible Notebook functions as both a conventional notebook and a tablet.','M285-E',NULL,'/t/o/toshiba-m285-e-14.jpg',NULL,NULL,NULL,NULL,2,'/t/o/toshiba-m285-e-14.jpg',NULL,'2014-04-27 19:32:07','toshiba-satellite-a135-s4527-155-4-notebook-pc-intel-pentium-dual-core-processor-t2080-1-gb-ram-120-gb-hard-drive-supermulti-dvd-drive-vista-premium','toshiba-satellite-a135-s4527-155-4-notebook-pc-intel-pentium-dual-core-processor-t2080-1-gb-ram-120-gb-hard-drive-supermulti-dvd-drive-vista-premium.html',4,10.0000,NULL),(44,44,'simple',NULL,24,'Black',NULL,NULL,NULL,NULL,200.0000,NULL,NULL,NULL,'2007-08-28 05:06:28',NULL,NULL,'','The Canon EOS Digital Rebel camera now has a new, faster, even smaller big brother. Sibling rivalries aside, the 8.0-megapixel Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. Even with its advancements in ergonomic design and technology, this easy-to-use EOS digital camera is compatible with all of Canon\'s EF lenses, including the EF-S lenses.','5 x 3.7