lusive. The HTC Touch Diamond has arrived.',0,NULL,NULL,NULL,122,'HTC',NULL,NULL,NULL,NULL,NULL,'','','',NULL,'HTC Touch Diamond',NULL,'4',2,'HTC Touch Diamond','2014-02-24 00:00:00','2014-04-24 00:00:00',NULL,750.0000,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Re-defining the perception of advanced mobile phones the HTC Touch Diamond signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.','HTC Touch Diamond',NULL,'/e/l/electronic-3.jpg',NULL,NULL,NULL,NULL,2,'/e/l/electronic-2.jpg',NULL,'2014-05-21 01:22:21','htc-touch-diamond','htc-touch-diamond.html',4,0.3000,NULL),(167,40,'simple',NULL,59,'Brown',NULL,NULL,NULL,NULL,10.0000,NULL,NULL,NULL,'2007-08-30 03:23:16',NULL,NULL,NULL,'Smooth kidskin upper in a dress platform wedge t-strap sandal style, with a round open toe, front and ankle adjustable buckles and tonal stitching accents. Ankle buckle features elastic panel. Smooth faux leather lining, cushioning faux leather and fabric topped insole. 1 inch matching leather and fabric wrapped midsole.',NULL,0,NULL,NULL,35,'Womens',NULL,NULL,NULL,0,'/o/p/opencart_digital_6.jpg',NULL,'<ul>\r\n<ul class=\"disc\">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon <br></li>\r\n<li>Guaranteed for the Life of the Sole - Non-slip sole<br></li>\r\n</ul>',0,NULL,NULL,NULL,102,'Anashria',NULL,NULL,NULL,NULL,NULL,'Anashria Womens Premier Leather Sandal','womens, sandal, leather, anashria, ','Anashria Womens Premier Leather Sandal',41.9500,'B000KJ43SG!',NULL,'4',2,'Anashria Womens Premier Leather Sandal',NULL,NULL,NULL,41.9500,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,43,'6',97,'Sandal','Buckle embellished contrasting straps adorn both the heel and canvas covered wedge of this t-strap sandal to make it a truly unique addition to your wardrobe','f