lis est, ut malesuada lorem dignissim quis. Pellentesqueer magna lectus dignissim Etiam nisi augue, consequat non risus ut, aliquet laoreet metus. Phasellus faucibus ante vel eros laoreet congue. In placerat hendrerit nisi. Sed eleifend vehicula dapibus. Cras tortor augue, cursus vel suscipit eulore pharetra eu lacus. Maecenas risus augue, rutrum feugiat Phasellus egestas mattis sem vitae euismod. Quisque urna nisi, molestie sed massa non, hendrerit molestie arcu. Donec accumsan lacinia justo in adipiscing.</p>\r\n<p>Aliquam quis risus viverra, ornare ipsum vitae, congue tellus. Vestibulum nunc lorem, scelerisque a tristique non, accumsan ornare eros. Nullam sapien metus, volutpat dictum orci non, suscipit aliquam elit. Nunc accumsan tincidunt odio sed pulvinar. Praesent tellus felis, aliquet id augue at, tincidunt vestibulum leo. Aliquam a porttitor nibh, et feugiat enim. Proin consequat ut lectus ac adipiscing. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec suscipit elit eu posuere malesuada. Morbi justo tellus, porttitor vitae semper sed, scelerisque non orci. Phasellus semper vulputate elementum.</p>','102 mm (L) X 51 mm (W) X 11.35 mm (T)',0,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'/a/d/adore-fashion-product-9.jpg',NULL,'Re-defining the perception of advanced mobile phones the HTC Touch Diamond signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.\r\n\r\nFeaturing a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use.\r\n\r\nWith HTCs vibrant touch-responsive user interface, TouchFLO 3D, and ultra-fast HSDPA internet connectivity the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends and familys faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.',0,NULL,NULL,NULL,122,'HTC',NULL,NULL,NULL,NULL,NULL,'','','',NULL,'HTC Touch Diamond',NULL,'4',2,'HTC Touch Diamond','2014-02-24 00:00:00','2014-04-24 00:00:00',NULL,750.0000,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Re-defining the perception of advanced mobile phones the HTC Touch Diamond signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.','HTC Touch Diamond',NULL,'/a/d/adore-fashion-product-10.jpg',NULL,NULL,NULL,NULL,2,'/a/d/adore-fashion-product-7.jpg',NULL,'2014-05-21 01:22:21','htc-touch-diamond','htc-touch-diamond.html',4,0.3000,NULL),(167,40,'simple',NULL,59,'Brown',NULL,NULL,NULL,NULL,10.0000,NULL,NULL,NULL,'2007-08-30 03:23:16',NULL,NULL,NULL,'Smooth kidskin upper in a dress platform wedge t-strap sandal style, with a round open toe, front and ankle adjustable buckles and tonal stitching accents. Ankle buckle features elastic panel. Smooth faux leather lining, cushioning faux leather and fabric topped insole. 1 inch matching leather and fabric wrapped midsole.',NULL,0,NULL,NULL,35,'Womens',NULL,NULL,NULL,0,'/a/d/adore-fashion-product-19.jpg',NULL,'<ul>\r\n<ul class=\"disc\">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon