INSERT INTO `review_detail` VALUES (19,19,1,'Vision of Vaio...','If you\'re buying this laptop, it\'s undoubtedly partially for the design, style and lightweight features of the TX series. You can get cheaper, better performing options at about the same weight, but it won\'t have the \"wow\" factor of this TXN27N. That being said let\'s get right into the pros and cons.\r\n\r\nAs a side note, if you\'re wondering about differences between the 25,27, 29 TX models, it\'s pretty straightforward. The 25 has 1GB RAM and 80GB hard drive, the 27 has 2GB RAM, 100 GB hard drive, the 29 is the same as the 27 except it comes with a carrying case and the exterior has a sleek special shiny coating. IMO, the 27N is the best value among the 3 when you look at the price points.\r\n\r\n','Chen',1),(20,20,1,'Sleek compact design for business travelers on the go.','I waited to get this notebook loaded with Vista. I have mixed feelings. The notebook hardware design is quite sleek and handsome. I am not so impressed with Vista running on this machine though. It just feels that Vista is a resource hog and is constantly running the CPU at 100% which causes the fan to run endlessly. I think the issue is that Sony used the same hardware specs as the previous TX series just to get a Vista version out quickly, but it really is not equipped to handle the new Vista OS as well. So I was disappointed when I upgraded to this notebook thinking that it would run faster, but actually it runs slower than my previous Vaio running Win XP. Though there are some improvements with Vista over XP, Vista probably runs better on a Duo Intel chipset than the Solo that is used in this notebook. The poor notebook is contantly working overtime just to do very simple normal every day applications and it takes forever to start up or reboot. If you just base it on looks alone, then it gets a 4 start rating.','Steven',1),(21,21,1,'Solid and reliable','At first, I wasn\'t terribly impressed. I had been accustomed to working\r\nwith a Toshiba Protege M405 at home and when I purchased the Gateway for\r\nexclusive use at the office, my initial impression of the machine when\r\nI put it into action was noticeably lacking in enthusiasm or excitement.\r\n\r\nI\'ve since come to appreciate this notebook for something much more\r\nimpressive that I couldn\'t gauge out of the box, and that was its\r\namazing reliability and performance over time.\r\n\r\nThis machine is solid. It does not crash.\r\n\r\n','Mendez',1),(43,43,1,' Another stunning winner from the bright minds at Canon','I spent three hours yesterday playing with the brand-new Canon Digital Rebel XT digital SLR camera, and man, was I impressed.\r\n\r\nI hadn\'t been too impressed with the original Digital Rebel, except for its revolutionarily low price (for a d-SLR), because it was slow and felt slimsy. The new DR XT is quite different. Even though it\'s 3 ounces lighter than the original DR -- mostly due to the use of a smaller battery; see below -- its smaller form factor actually makes it feel more solid and \"real\". In other word, unlike the original DR, this one feels professional, not toy-like at all.\r\n\r\n\r\n','Mira',1),(44,44,1,' The best thing I\'ve ever bought','The XT is amazing. The battery comes partly charged so you can immedietly start using the camera (thank you Canon!) I\'ve already shot about 200 pictures with it and the battery hasn\'t died yet.\r\n\r\n\r\n\r\n\r\n','Al',1),(47,47,1,'I love this Ottoman','Best Ottoman ever!!!!','Terry Ferguson',1),(51,51,1,'Good Camera','    	\r\n77 of 82 people found the following review helpful:\r\nGood Camera, October 11, 2006\r\nBy 	Steve (FL) - See all my reviews\r\nGot it yesterday. In green. Actually it\'s a shiney yellowish-green. Nice feel. Fits well in shirt pocket. Very light; particullarly compared to my Pentax Optio 550. Good, nice size LCD. Easy to use yet with nice availability of choices for customization. Well written manual (you can find online thru google) and onboard help menu. Photos come out fairly nice. Tried indoors in low light with several scene settings, outdoors, macro, and supermacro. Colors look true, fairly sharp without noticable artifact. Used in South Florida morning daylight outside without any trouble with LCD viewing (camera has no classic viewfinder). Have read reviews of washout in bright sun: have not tried that yet. Overall, I\'m happy with the camera thus far. ','Jenella',1),(52,52,1,'Great inexpensive Couch','I love this couch...  extremely comfortable and easy to clean\r\n','Toish',1),(61,61,1,'Light-weight small laptop','Sony VAIO TX serie is amazing light-weight laptop that I\'ve ever seen it. But TZ is lastest and lighter than TX series.','Tarzan',1),(65,65,2,'Solid Laptop','Expensive but solidly built laptop','Tommy',1),(66,66,1,'not bad','yeah it\'s alright I suppose','ryhrhrh',NULL),(70,70,1,'This ist great - Love the style','I`ve been looking for such a couch for months now I\'ve found it!','JBrunner',1),(71,71,1,'Looks Good','Looks good and nice. Highly recommended ;)','devx',NULL),(76,76,1,'Excellent quality','The Sony producs have alway had an excellent quality and value.','Dr. Gish',NULL),(77,77,1,'This notebook is great','This very high quality notebook great for office and business applications. ','tane',NULL),(84,84,1,'Cool application','This looks very nice I\'ll have to check out the back end','Nick',NULL),(86,86,1,'A typical Sony product','Review goes here...','chucker',1),(87,87,2,'i love this product','i love this product','german',NULL),(88,88,1,'A little expensive for what you get','To be honest, the quality of the pictures it takes is excellent. But there are other cameras out there that do just a good a job for $100 less.','JohnnyBoy',NULL),(89,89,1,'Not Bad','perhaps i should have bought six instead of sixty six','Burt',NULL),(95,95,3,'test','that\'s a very good product','swisswine',NULL),(96,96,1,'Amazing','Holy-Moly.','Crazy Pants',NULL),(100,100,1,'Word ottoman ever','I know because I am king of the Ottoman Empire','Xerses',1),(101,101,1,'This is a great camera','This camera rocks,  Solid. beautiful pictures ','bob',NULL),(105,105,1,'great website','great website','smerphy',1),(106,106,1,'Good choice','I think this is the best laptop i\'ve ever tried','Ata',NULL),(116,116,1,'fadfad','fadfadf','hfadfad',2),(117,117,1,'fafad','fadfad','h',2),(118,118,1,'sfdas','dsfa','Kieu',3),(119,119,1,'dg','dfgs fdsg','Kieu',3),(120,120,NULL,'Good','Good','May',NULL),(121,121,NULL,'Good','Good','Rose',NULL),(122,122,NULL,'Okey','Okey','Mary',NULL),(123,123,NULL,'Ok','Ok','Peter',NULL),(124,124,NULL,'Ok','Ok','Nick',NULL),(125,125,NULL,'Ok','Thank','John',NULL),(126,126,NULL,'Good','Good','Fury',NULL),(127,127,NULL,'Nice','Nice','Maria',NULL),(128,128,NULL,'Good','Thanks','Anna',NULL),(129,129,NULL,'Ok','Ok','Ward',NULL),(130,130,1,'fadfadfa','fadfadfad','h',2),(131,131,NULL,'dfs','sdfs sdfs','Kieu',3),(132,132,NULL,'djk','ljq','kendy',3),(133,133,NULL,'sdf ','sdfa','lady',3),(134,134,NULL,'sdf sdf','sdg adfsa','suly',3),(135,135,NULL,'ds ','fas dsf ','sasa',3),(136,136,NULL,'Test','Test','Test',NULL),(137,137,NULL,'Test','Test','Test',NULL),(138,138,NULL,'Test','Test','Test',NULL),(139,139,NULL,'Test','Test','Test',NULL),(140,140,NULL,'Test','Test','Test',NULL),(141,141,NULL,'Test','Test','Test',NULL),(142,142,NULL,'Test','Test','Test',NULL),(143,143,NULL,'Test','Test','Test',NULL),(144,144,NULL,'Galathemes','Galathemes','Galathemes',NULL),(145,145,NULL,'Galathemes','Galathemes','Galathemes',NULL),(146,146,NULL,'Galathemes','Galathemes','Galathemes',NULL),(147,147,NULL,'Galathemes','Galathemes','Galathemes',NULL),(148,148,NULL,'Galathemes','Galathemes','Galathemes',NULL),(149,149,NULL,'Galathemes','Galathemes','Galathemes',NULL),(150,150,NULL,'Galathemes','Galathemes','Galathemes',NULL),(151,151,NULL,'Galathemes','Galathemes','Galathemes',NULL),(152,152,NULL,'aaa','aa','aaa',NULL),(153,153,1,'Good','Good','Mary',NULL),(154,154,1,'Rose','Ro